import './App.css'

function App() {
  const [data, setData] = useState(null);

    useEffect(() => {
        fetch('http://localhost:5000')
            .then(response => response.json())
            .then(data => setData(data));
    }, []);

    return (
        <div className="App">
            <header className="App-header">
                {data ? <p>{data.message}</p> : <p>Loading...</p>}
            </header>
        </div>
    );
}

export default App
